let tm = null;

let current_w_memo = $(window).width();

$(window).on('resize', function() {

    if(current_w_memo != $(window).width()) {
        try{
            $().timelinr({
                arrowKeys: 'true',
                startAt:1,
            });
            myCounter.numberAnimate('set', $('#dates .selected').html().replace(/(<([^>]+)>)/gi, ""));
        }catch(e) {}
        myCounter.removeAttr('style');
        myCounter.css('opacity', 0);
        myCounter.numberAnimate('destroy');
        clearTimeout(tm);
        tm = setTimeout(() => {
            myCounter.numberAnimate({
                animationTimes: [100, 500, 100],
            });
            myCounter.css('opacity', 1);
        },200);
        menu_height = $('#header').height();
        current_w_memo = $(window).width()
    }
})

